import './style.scss';

import Logo from './../../assets/image2.jpg';

const Header = props => {
  return (
    <header className="header">
      <div className="wrap">
        <div className="logo">
            <img src={Logo} alt="SimpleTut LOGO" />
        </div>
      </div>
    </header>
  );
};
export default Header;
